import {
  Button,
  Grid,
  Stack,
  useTheme,
  useMediaQuery,
  Typography,
  IconButton,
} from "@mui/material";
import AccountCircleIcon from "@mui/icons-material/AccountCircle";

export const Profile = () => {
  const theme = useTheme();
  const matches = useMediaQuery(theme.breakpoints.up("md"));
  const widthCalc = `calc(100vw - ${matches ? "200" : "75"}px)`;
  return (
    <Grid
      width={widthCalc}
      justifyContent={"center"}
      alignItems={"center"}
      container
    >
      <Grid
        sm={8}
        item
        container
        justifyContent={"space-around"}
        direction={"row"}
        spacing={1}
      >
        <Grid sm={4} item>
          <IconButton color={"primary"} size={"large"}>
            <AccountCircleIcon fontSize="50px" />
          </IconButton>
        </Grid>
        <Grid sm={6} item>
          <Stack direction="column">
            <Typography color={"#fff"} variant={"h4"}>
              Dr. Stephen Strange
            </Typography>
            <Typography color={"#ddd"} variant={"subtitle1"}>
              @drstrange
            </Typography>
          </Stack>
        </Grid>
        <Grid sm={2} item>
          <Button
            sx={{ borderRadius: "20px" }}
            color={"primary"}
            variant="outlined"
          >
            Edit Profile
          </Button>
        </Grid>
      </Grid>
      <Grid sm={4} item container justifyContent={"center"}>
        <Button>Right Nav</Button>
      </Grid>
    </Grid>
  );
};
